import { 
  Container, 
  Typography, 
  Box, 
  Button
} from '@mui/material';

function Home() {
  return (
    <Box sx={{ pt: 12, pb: 8 }}>
      <Container maxWidth="lg">
        <Box 
          sx={{ 
            textAlign: 'center',
            mb: 8
          }}
        >
          <Typography 
            variant="h2" 
            component="h1"
            sx={{ 
              fontWeight: 700,
              mb: 2,
              background: 'linear-gradient(45deg, #2563eb 30%, #3b82f6 90%)',
              WebkitBackgroundClip: 'text',
              WebkitTextFillColor: 'transparent'
            }}
          >
            Discover Your Dream Car
          </Typography>
          <Typography 
            variant="h5" 
            color="text.secondary"
            sx={{ mb: 4 }}
          >
            Experience luxury and performance with our exclusive collection
          </Typography>
          <Button 
            variant="contained" 
            size="large"
            sx={{ 
              px: 4,
              py: 1.5,
              fontSize: '1.1rem'
            }}
          >
            View Collection
          </Button>
        </Box>
      </Container>
    </Box>
  );
}

export default Home;
